import "./Main.css";



const Main = () => {
  return (
    <main>
      <div className="main__container">
        {/* <!-- MAIN CARDS STARTS HERE --> */}
        <div className="main__cards">
          <div className="card1">
            <i
              className="fa fa-user-o fa-2x text-lightblue"
              aria-hidden="true"
            ></i>
            <div className="card_inner1">
              <h2 className="text_white">Arcade Game</h2>
            </div>
          </div>


        </div>

    </div>
    </main>
  );
};

export default Main;
